INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 0, 1, 1, 10040, "2020/04/30 12:00:00", 24001, "あたしだって\nやるときはやるよ！", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 1, 1, 1, 10040, "2020/04/30 12:00:00", 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 2, 1, 1, 10040, "2020/04/30 12:00:00", 24003, "終わった終わった\n一人でもなんとか\nなるもんだね", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 3, 2, 2, 10040, "2020/04/30 12:00:00", 24004, "やったね！\nこれでようやく\nサボれるよ…", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 4, 1, 1, 10040, "2020/04/30 12:00:00", 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 5, 2, 2, 10040, "2020/04/30 12:00:00", 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 6, 2, 2, 10040, "2020/04/30 12:00:00", 24007, "あたしも意外と\nやるもんでしょ？", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 7, 4, 4, 10040, "2020/04/30 12:00:00", 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 8, 4, 4, 10040, "2020/04/30 12:00:00", 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 9, 4, 4, 10040, "2020/04/30 12:00:00", 24010, "まじめに\nやったんだけどな…\n悔しいな～", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 10, 4, 4, 10040, "2020/04/30 12:00:00", 24011, "やられた…\nねずみって意外と\nてごわいね", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, "リン", 102601, 24, 11, 4, 4, 10040, "2020/04/30 12:00:00", 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！", "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (1.81, "リン", 102601, 24, 12, 1, 4, 10040, "2020/04/30 12:00:00", 24013, "疲れた…\nけど、次こそは\n守り抜くよ…", "2030/12/17 14:59:59", 0.0, 0.0);
